return checkers.map(name => ({ json: { checker: name } }));

const idCount = {};

for (const item of items) {
  const id = item.json['TIKTOK Order ID'];
  idCount[id] = (idCount[id] || 0) + 1;
}

return items.filter(item => {
  const id = item.json['TIKTOK Order ID'];
