});

const allRows = items;
const checkerByID = {};

// Bước 1: Gộp checker theo TikTok Order ID
for (const row of allRows) {
  const id = row.json['TIKTOK Order ID'];
  const checker = row.json.checker;

  if (id && checker && checker !== 'undefined') {
    checkerByID[id] = checker;
  }
}

// Bước 2: Bổ sung checker nếu đang undefined
const output = allRows.map(row => {
  const id = row.json['TIKTOK Order ID'];

  if ((!row.json.checker || row.json.checker === 'undefined') && checkerByID[id]) {
    row.json.checker = checkerByID[id];
  }

  return row;
});

return output;

// Bước 1: Tạo bản đồ ID -> row_number
const idToRowNumber = {};

for (const row of items) {
  const id = row.json['TIKTOK Order ID'];
  const rowNumber = row.json['row_number'];

  if (id && rowNumber && rowNumber !== '[undefined]') {
    idToRowNumber[id] = rowNumber;
  }
}

// Bước 2: Lọc các dòng hợp lệ
const output = items.filter(row => {
  const checker = row.json['Checker'];
  const id = row.json['TIKTOK Order ID'];

  // Nếu checker tồn tại và không undefined và có id đã map row_number
  return checker && checker !== '[undefined]' && idToRowNumber[id];
}).map(row => {
  const id = row.json['TIKTOK Order ID'];

  // Gán lại row_number đúng
  row.json['row_number'] = idToRowNumber[id];

  return row;
});

return output;

return items.filter(row => {
  const checker = row.json['checker'];
  const Checker = row.json['Checker'];

  return (
    checker !== Checker &&
    checker !== undefined &&
    Checker !== undefined
  );
});

const groups = {};
for (const item of items) {
  const id = item.json["TIKTOK Order ID"];
  if (!groups[id]) groups[id] = [];
  groups[id].push(item);
}

const result = [];

for (const id in groups) {
  const group = groups[id];
  if (group.length === 1) continue;

  const ref = group.find(i =>
    i.json.Checker !== undefined &&
    i.json.checker !== undefined
  );

  const target = group.find(i =>
    i.json.Checker === undefined || i.json.checker === undefined
  );

  if (ref && target) {
    target.json.Checker = ref.json.Checker;
    target.json.checker = ref.json.checker;
    result.push(target);
  }
}

return result;
